import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./index.css";
import reportWebVitals from "./reportWebVitals";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// üîπ Envia m√©tricas para Google Analytics
reportWebVitals((metric) => {
  if (window.gtag) {
    window.gtag("event", metric.name, {
      value: Math.round(metric.value), // arredonda para inteiro
      event_category: "Web Vitals",
      event_label: metric.id, // ID √∫nico da m√©trica
      non_interaction: true, // n√£o afeta taxa de rejei√ß√£o
    });
  }
});
